atra\u2019s palace and Alexandria\u2019s old lighthouse, once a wonder of the ancient world.", "Cleopatra\u2019s palace sank long ago into the Mediterranean, but visitors to Alexandria, Egypt, may eventually view the complex\u2019s remnants via the world\u2019s first underwater museum", "Just off the shores of Alexandria lies what is believed to be the palace of Cleopatra, an ancient Egyptian queen. It is believed that the ruins were cast into the sea by an earthquake over years ago and lay dormant until recent years."], "visual_annotation": ["Sunken City", "Ancient Ruins", "Ancient Egyptian Art", "Ancient Egypt History", "Egyptian Queen", "Ancient Beauty", "Ancient Greek", "Palaces", "Wanderlust"], "canonical_pin": {"id": "501869952202870767"}, "country_canonical_pins": {"BE": 480970435179862338, "FR": 575616396101181970, "DK": 450922981415794359, "DE": 611152611902585427, "JP": 554365035371538410, "BR": 440930619751985790, "RU": null, "NL": 217298750741912635, "PT": 104286547593802843, "NO": 316096467571312579, "TR": null, "NZ": 544302304942567866, "TH": null, "PH": null, "CH": 545146729873432442, "CO": 365354588490887497, "CL": 455285843550748759, "CA": 119415827590513109, "IT": 306737424598753261, "VN": null, "AR": 571042427743883807, "AU": 569142471642904283, "GB": 471400285974943791, "IN": null, "IE": 344314333987705097, "ID": null, "ES": 52002570667717418, "US": 501869952202870767, "KR": 562809284658898593, "MX": 305541155949476015, "SE": 766737905279361692, "AT": 20336635789593411}}, "rich_summary": {"display_name": "", "type_name": "aggregated app link", "site_name": "Facebook", "apple_touch_icon_images": {"orig": "https://i.pinimg.com/favicons/170d6fdb1d00ee655b36918178fddb27b1f53b522ebd6d5cfc9e86e4.png?b92ee8d404a8140c04c2a808c37bfc4d"}, "favicon_images": {"50x": "https://i.pinimg.com/favicons/50x/527131f8f49c775e4bc1cf47c8dfc0ab78b615a8fb2fea45aa36d909.png?7e765f1c4cb20568118ed55c0b6ffa91", "orig": "https://i.pinimg.com/favicons/527131f8f49c775e4bc1cf47c
